var Steps={};Steps.init=function(){this.buildParseUrl();this.bindBtn("#step-1-btn",function(a){ParseRequest.postData();a.preventDefault()})};Steps.buildParseUrl=function(){var a=Config.getUrl();$("#parse-url").html(a+"/parse")};Steps.bindBtn=function(b,a){$(b).click(a)};Steps.closeStep=function(a){$(a).addClass("step--disabled")};Steps.openStep=function(a){$(a).removeClass("step--disabled")};Steps.fillStepOutput=function(b,a){$(b).html("Output: "+a).slideDown()};Steps.fillBtn=function(b,a){$(b).addClass("success").html("âœ“  "+a)};Steps.showWorkingMessage=function(){$("#step-4").delay(500).slideDown()};var ParseRequest={};ParseRequest.postData=function(){XHR.setCallback(function(a){Store.objectId=JSON.parse(a).objectId;Steps.closeStep("#step-1");Steps.fillStepOutput("#step-1-output",a);Steps.fillBtn("#step-1-btn","Posted");Steps.openStep("#step-2");Steps.bindBtn("#step-2-btn",function(b){ParseRequest.getData();b.preventDefault()})});XHR.POST("/parse/classes/GameScore")};ParseRequest.getData=function(){XHR.setCallback(function(a){Steps.closeStep("#step-2");Steps.fillStepOutput("#step-2-output",a);Steps.fillBtn("#step-2-btn","Fetched");Steps.openStep("#step-3");Steps.bindBtn("#step-3-btn",function(b){ParseRequest.postCloudCodeData();b.preventDefault()})});XHR.GET("/parse/classes/GameScore")};ParseRequest.postCloudCodeData=function(){XHR.setCallback(function(a){Steps.closeStep("#step-3");Steps.fillStepOutput("#step-3-output",a);Steps.fillBtn("#step-3-btn","Tested");Steps.showWorkingMessage()});XHR.POST("/parse/functions/hello")};var Store={objectId:""};var Config={};Config.getUrl=function(){if(b){return b}var a=window.location.port;var b=window.location.protocol+"//"+window.location.hostname;if(a){b=b+":"+a}return b};var XHR={};XHR.setCallback=function(b){this.xhttp=new XMLHttpRequest();var a=this;this.xhttp.onreadystatechange=function(){if(a.xhttp.readyState==4&&a.xhttp.status>=200&&a.xhttp.status<=299){b(a.xhttp.responseText)}}};XHR.POST=function(b,c){var a={score:1337,playerName:"Sean Plott",cheatMode:false};this.xhttp.open("POST",Config.getUrl()+b,true);this.xhttp.setRequestHeader("X-Parse-Application-Id","myAppId");this.xhttp.setRequestHeader("Content-type","application/json");this.xhttp.send(JSON.stringify(a))};XHR.GET=function(a,b){this.xhttp.open("GET",Config.getUrl()+a+"/"+Store.objectId,true);this.xhttp.setRequestHeader("X-Parse-Application-Id","myAppId");this.xhttp.setRequestHeader("Content-type","application/json");this.xhttp.send(null)};Steps.init();